<p>zookeeper 提供了数据的 <code>发布/订阅功能</code>，多个订阅者可同时监听某一特定的主题对象，当主题对象的自身状态发生了变化时（例如节点内容发生了改变、节点下的子节点列表发生改变等），会实时、主动的通知所有订阅者。</p>
