<li><strong>心理医生</strong>：列出系统内的心理医生信息，方便用户查看和选择。</li>
<li><strong>心理咨询</strong>：提供在线心理咨询预约功能，用户可以选择合适的心理医生进行预约。</li>
<li><strong>心理论坛</strong>：用户可以在此发表和查看关于心理学的讨论和文章。</li>
<li><strong>智能心理</strong>：提供智能心理测试功能，用户可以选择对应的测试题目进行测试。</li>
<li><strong>公告信息</strong>：展示系统发布的最新公告和通知。</li>
<li><strong>留言板</strong>：用户可以在此留言，与其他用户或管理员进行互动。</li>
<li><strong>后台管理</strong>（对用户而言为访问权限受限的模块入口提示）：虽然用户无法直接访问后台管理，但此入口提示了后台管理的存在，便于管理员操作。</li>
